void quickSort( int *data, int n ) {
	int low[ 30 ] = { 0 }, high[ 30 ] = { n - 1 }, sp = 1;

	while ( sp-- ) {
		int l = low[ sp ], r = high[ sp ];

		if ( l < r ) {
			int i = l, j = r, pivot = median( data[ i ], data[ ( i + j ) / 2 ], data[ j ] );

			while ( 1 ) {
				for ( ; data[ i ] < pivot; i++ ) ;
				for ( ; pivot < data [ j ]; j-- ) ;
				if ( i >= j )
					break;

				SWAP( data[ i ], data[ j ] );

				i++;
				j--;
			}

			if ( i - l < 20 )
				insertionSort( data + l, i - l );
			else {
				low[ sp ] = l;
				high[ sp ] = i - 1;
				sp++;
			}

			if ( r - j < 20 )
				insertionSort( data + j + 1, r - j );
			else {
				low[ sp ] = j + 1;
				high[ sp ] = r;
				sp++;
			}
		}
	}
}
